import LifeSimulation from './LifeSimulation'
import Instruction from './Instruction'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav';


export default function Header () {

    return (
        <Router>
            <Navbar bg="light" fixed='top' className="justify-content-between">
                <Nav.Link href="/">
                    Home
                </Nav.Link>
                <Navbar.Brand className="hide" href="/" aria-hidden="true">Conway's History of Life</Navbar.Brand>
                <Nav ><Link to="/instruction">Instruction</Link></Nav>
            </Navbar>
            <Switch>
                <Route path="/instruction">
                    <Instruction />
                </Route>
                <Route path="/lifesimulation">
                    <LifeSimulation />
